import React, { Component } from 'react'
import ChildComponent from './ChildComponent'

class ParentComponent extends Component {
    constructor(){
        super()
        this.state = {
            componentName: 'Parent'
        }
    }

    showComponent(){
        alert(`Hello $(this.state.componentName)`)
    }

    render() {
        return (
            <div>
                <ChildComponent />
            </div>
        )
    }
}

export default ParentComponent
